int IsBlinkingNeeded(int BlinkType)
{
    signed int nOnDuration = 0;
    signed int nOffDuration = 0;

    switch (BlinkType)
    {
    case DEFAULT:
        return 0;
    case RANDOM_FLASHING:
        nOnDuration = 500;
        nOffDuration = 500;
        break;
    case T_1S_ON_1S_OFF:
        nOnDuration = 1000;
        nOffDuration = 1000;
        break;
    case T_2S_ON_2S_OFF:
        nOnDuration = 2000;
        nOffDuration = 2000;
        break;
    case T_3S_ON_3S_OFF:
        nOnDuration = 3000;
        nOffDuration = 3000;
        break;
    case T_4S_ON_4S_OFF:
        nOnDuration = 4000;
        nOffDuration = 4000;
        break;
    case T_5S_ON_5S_OFF:
        nOnDuration = 5000;
        nOffDuration = 5000;
        break;
    case T_6S_ON_4S_OFF:
        nOnDuration = 6000;
        nOffDuration = 4000;
        break;
    default:
        return 0;
    }

    return CTimer__m_snTimeInMillisecondsPauseMode() % (nOnDuration + nOffDuration) < nOnDuration;
}

float Q_rsqrt(float number)
{
    const float x2 = number * 0.5F;
    const float threehalfs = 1.5F;

    union {
        float f;
        uint32_t i;
    } conv = { number };
    conv.i = 0x5f3759df - (conv.i >> 1);
    conv.f *= threehalfs - x2 * conv.f * conv.f;
    return conv.f;
}

